‰≈–Z<?php exit; ?>a:6:{s:10:"last_error";s:0:"";s:10:"last_query";s:47:"SELECT * FROM wpw6_posts WHERE ID = 644 LIMIT 1";s:11:"last_result";a:1:{i:0;O:8:"stdClass":23:{s:2:"ID";s:3:"644";s:11:"post_author";s:1:"1";s:9:"post_date";s:19:"2017-12-25 23:16:42";s:13:"post_date_gmt";s:19:"2017-12-25 17:31:42";s:12:"post_content";s:14653:"<p style="text-align: justify;">The FIFA World Cup is the most prestigious and respectable tournament in the world football and with<a href="http://wikiceleb.com/russia-host-fifa-world-cup-2018/" target="_blank" rel="noopener"> Russia‚Äôs</a> 2018 tournament edition almost at our doorstep, many strikers, wingers or many players will be seeking to show their capabilities and to write their names in the world football. Talking about the strikers and wingers, they are in the eye of football fans because they are more responsible for scoring goals. Forwards in the football team are the players who play closest to the opposing team‚Äôs goal and are therefore score more goal than other teammates. And a winger is an attacking player who is responsible to beat opposing full-backs, crosses from a wide position with their speed, skill, and vision. Here are 11 of the best strikers/wingers in the world.</p>
11.¬†<strong>Sadio Mane</strong>

<img class="aligncenter wp-image-646" src="http://wikiceleb.com/wp-content/uploads/2017/12/sadio-mane-1-300x199.jpg" alt="" width="540" height="358" />

Full Name: Sadio Mane

Birth Date: 10 April 1992

Age: 25

Nation: <a href="http://wikiceleb.com/senegal-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Senegal</a>

Current Club: Liverpool FC
<p style="text-align: justify;">Sadio Mane is the most loved footballer by Liverpool fans where he made an immediate impact for English premier league side Liverpool FC after the transfer from Southampton. His pace and creativity from wings is a thing to watch. His national side Senegal from South Africa was qualified after many years so Mane is the main man to lead his nation in upcoming FIFA world cup. He has 46 international caps for Senegal with 13 goals.</p>
10.<strong>Raheem Sterling</strong>

<img class="aligncenter wp-image-647" src="http://wikiceleb.com/wp-content/uploads/2017/12/Raheem-Shaquille-Sterling-300x200.jpg" alt="" width="531" height="354" />

Full Name: Raheem Shaquille Sterling

