Current Club: Liverpool FC
<p style="text-align: justify;"><strong>¬†</strong>In 2017/18 season, Mohamed Salah was the man in a form where he¬†has found the net in almost games for English premier league club Liverpool FC. He captains his national side <a href="http://wikiceleb.com/egypt-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Egypt</a> who is qualified for FIFA world cup for the first time in many decades. His goals in qualifying round were vital for <a href="http://wikiceleb.com/egypt-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Egypt</a> to qualify for FIFA world cup. He is capable of playing winger and second striker. As his sides were qualified after a long time he has a huge responsibility to carry his team like he did in qualifying round. For <a href="http://wikiceleb.com/egypt-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Egypt</a>, he has 56 international caps with overall 32 goals in all competitions.</p>
7.<strong>Paulo Dybala</strong>

<img class="aligncenter wp-image-650" src="http://wikiceleb.com/wp-content/uploads/2017/12/dybala-1-300x168.jpg" alt="" width="543" height="304" />

<strong>¬†</strong>

Full Name: Paulo Bruno Exequiel Dybala

