Current Club: Juventus
<p style="text-align: justify;"><strong>¬†</strong>Paulo Dybala also called ‚ÄúNext Messi‚Äù is a central forward player who has the capability to play as winger, second striker or even no.10 positions. Due to his dribbling, visions and goal scoring capacity, he is called second Messi of <a href="http://wikiceleb.com/argentina-russia-world-cup-2018/" target="_blank" rel="noopener">Argentina</a>. Although he has not featured most for <a href="http://wikiceleb.com/argentina-russia-world-cup-2018/" target="_blank" rel="noopener">Argentina</a> as he is young but due to his current development and form he is surely going to play FIFA world cup with the likes of other forwards like Messi, Icardi, Di-Maria, Aguero, etc. He has only 12 international caps for <a href="http://wikiceleb.com/argentina-russia-world-cup-2018/" target="_blank" rel="noopener">Argentina</a> and has not found goal yet but we will see his goals and assist more in upcoming FIFA world cup.</p>
<strong>¬†</strong>6.<strong>Mario Mandzukic</strong>

