<p style="text-align: justify;">Griezmann plays a false 9 role for his club Atletico Madrid and regarded as one of the star players in the world. Due to his versatility in up front, he was linked with several clubs like Manchester United and Barcelona. FIFA world cup will be the great platform for him to carry his national side <a href="http://wikiceleb.com/france-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">France</a> with many other talented players. He will surely be a central forward or winger for <a href="http://wikiceleb.com/france-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">France</a> in coming FIFA world cup. He has 49 international caps with 19 goals in all competition.</p>
