<p style="text-align: justify;">One of the most loved footballers Neymar who captains his national side <a href="http://wikiceleb.com/brazil-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Brazil</a> in FIFA world cup has enormous skills, visions and goal scoring capability. He is the most expensive football player in the world where PSG bought him from Barcelona in record transfer fees. As <a href="http://wikiceleb.com/brazil-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Brazil</a> is the most watched nation in FIFA world cup, Neymar is their main player who has a huge responsibility to lead Brazil in FIFA world cup. This talented forward has very good goal scoring ratio for ¬†¬†¬†¬†¬†¬†¬†¬† Brazil where he has 83 international caps with 53 goals.</p>
2.<strong>Lionel¬†Messi</strong>

