<p style="text-align: justify;"><strong>¬†</strong>Cristiano Ronaldo was the main man to lead <a href="http://wikiceleb.com/portugal-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Portugal</a> for world cup qualifying and Euro cup winner last year. He also captains his national side and known as the most famous footballer not only for <a href="http://wikiceleb.com/portugal-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Portugal</a> but also over the entire world who has got most followers. He has scored many goals for his club Real Madrid and <a href="http://wikiceleb.com/portugal-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Portugal</a> which is a record for both sides. He is one of the highest scoring wingers in football history having many technical skills like free kicks, heading, pace and vision. The five-times Ballon‚Äôdor winner Cristiano Ronaldo has 147 overall international caps with 79 goals for <a href="http://wikiceleb.com/portugal-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Portugal</a>. He will be one of the most watched players in upcoming FIFA world cup.</p>
